    private fun myGet(url: String, myHeaders: Headers) = GET(url, myHeaders)

    private fun authIntercept(chain: Interceptor.Chain): Response {
        val url = chain.request().url().toString()
        if (url.contains(".jpg")) {
            var imageHeaders = Headers.of(mapOf(
                "User-Agent" to phone.get((1..40).random()),
                "Accept" to "image/avif,image/webp,image/apng,image/*,*/*;q=0.8",
                "Accept-Encoding" to "gzip, deflate",
                "ccept-Language" to "zh-CN,zh;q=0.9",
                "Referer" to "http://www.${url.substring(0, url.indexOf(".com")).substring(url.indexOf(".") + 1, url.indexOf(".com"))}.com/",
                "Connection" to "keep-alive",
                "Host" to "${url.substring(0, url.indexOf(".com")).substring(url.indexOf("://") + 3, url.indexOf(".com"))}.com"
            ))

            val authRequest = GET(url, imageHeaders)
            return chain.proceed(authRequest)
        } else {
            return chain.proceed(chain.request())
        }
    }

    override val client: OkHttpClient =
        network.client.newBuilder()
            .addInterceptor { authIntercept(it) }
            .build()

    private fun simpleMangasByElements(document: Document, requestUrl: String): MangasPage {
        var mangasElements = document.select("div.img li")
        var mangas = ArrayList<SManga>()
        for (mangaElement in mangasElements) {
            mangas.add(SManga.create().apply {
                title = mangaElement.select("div.title a").text().toString()
                thumbnail_url = mangaElement.select("img").get(0).attr("src")
                url = requestUrl.split(".com")[0] + ".com" + mangaElement.select("a").attr("href")
            })
        }
        return MangasPage(mangas, true)
    }

    override fun popularMangaRequest(page: Int): Request {
        var myHeaders = Headers.of(mapOf(
            "User-Agent" to phone.get((1..40).random()),
            "Accept" to "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9",
            "Accept-Language" to "zh-CN,zh;q=0.9",
            "Referer" to "http://${JSONArray(baseUrlJson).getJSONObject(page - 1).getString("url")}",
            "Upgrade-Insecure-Requests" to "1",
            "Connection" to "keep-alive",
            "Host" to "${JSONArray(baseUrlJson).getJSONObject(page - 1).getString("url")}"
        ))
        var num = (0..JSONArray(baseUrlJson).length() - 1).random()
        var numPage = 0
        if (num < 80) {
            numPage = num + page - 1
        } else {
            numPage = num - page - 1
        }
        return myGet("""http://${JSONArray(baseUrlJson).getJSONObject(numPage).getString("url")}""", myHeaders)
    }

    override fun popularMangaParse(response: Response): MangasPage {
        var requestUrl = response.request().url()!!.toString()
        val document = Jsoup.connect(requestUrl).get()
        return simpleMangasByElements(document, requestUrl)
    }

