    private fun getRandom(x: Int, y: Int): Int {
        var num = -1
        // 说明：两个数在合法范围内，并不限制输入的数哪个更大一些
        num = if (x < 0 || y < 0) {
            return num
        } else {
            val max = Math.max(x, y)
            val min = Math.min(x, y)
            val mid = max - min // 求差
            // 产生随机数
            (Math.random() * (mid + 1)).toInt() + min
        }
        return num
    }

